import React from "react";
import {useNavigate ,useParams} from 'react-router-dom'
function Profil(){
    let navigate=useNavigate();
    let username=useParams();

    return <div>Profil PAGE for {username}
        <button onClick={()=>
        navigate("/")}>Retour</button>
    </div>
}
export default Profil
